import React from "react";
import { Link } from "react-router-dom";
import "../css/Body.css";

function Body() {
  return (
    <>
      <p>Welcome to my SkyFinder application!</p>
      <p>Find the best deals on flights.</p>
      <div className="login-btn">
        <Link to="/login">Login</Link>
      </div>
    </>
  );
}

export default Body;
